  const [tabs, setTabs] = useState("red")

  return (
    <div>
      <div>
        <button onClick={() => setTabs("red")}>Red</button>
        <button onClick={() => setTabs("blue")}>Green</button>
        <button onClick={() => setTabs("green")}>Blue</button>
      </div>
      <div>
        {
          tabs=="red"
          ? <div style={{height:"90vh", backgroundColor:tabs}}></div>
          : tabs=="blue" 
          ? <div style={{height:"90vh", backgroundColor:tabs}}></div>
          :  <div style={{height:"90vh", backgroundColor:tabs}}></div>
        }
      </div>
    </div>
  )
}

